@lollapalooza thank you for showing up early on the last day and raging with me in the mud! We had the the time of our lives and I am so honored to be apart of this amazing festival’s history. Chicago holds a place near and dear to my heart, it was the first place I ever toured; the place that has inspired me to be the artist I am. House music was born here and it will never die. I ❤️ U FOREVER CHITOWN.

Huge thank you to my whole squad for working their ass off as well to make our dream a living truth. @jasonvasile @hitwiththerico @kylebandler @wmemusic @littleempiremusic @erikmolr @jbillzphotos @okaydanco 

